  {
   "cell_type": "markdown",
   "id": "5a9c0ded-0d54-49b8-905a-e642f73f12a2",
   "metadata": {},
   "source": [
    "Class imbalance is a common challenge in many real-world tasks. When dealing with imbalanced data in classification, algorithms can end up favoring the majority class, resulting in models that simply predict the most common class. This can also make standard metrics misleading. For instance, if a dataset has 99.9% instances of class 0 and 0.01% instances of class 1, a classifier that always predicts class 0 could achieve 99.9% accuracy.\n",
    "\n",
    "To tackle this issue, there are strategies available. One approach is to use the SMOTE (Synthetic Minority Oversampling Technique) algorithm. This method identifies similar records to the ones in the minority class and creates synthetic records that are a blend of the original and neighboring records, with weights assigned separately for each predictor.\n",
    "\n",
    "I'll employ the SMOTE function from the imblearn library, setting the sampling_strategy to 'auto'."
   ]
  },
